import React from 'react'
import wave from './../images/wave.svg'
import '../styles/footer.scss'

export default function Footer() {
    return (
        <div>
           <img src={wave} alt="footer"/> 
           <div className="footer">
               <div className="brand-name">Coding Den</div>
           </div>
        </div>
    )
}
